Herrera y Reissig fue un poeta uruguayo que vivió entre 1875 y 1910. Este poema es característico de su estilo modernista y decadentista, con elementos simbolistas y referencias culturales complejas, típicas de su obra. El poema pertenece a su etapa de madurez poética, cuando escribía desde "La Torre de los Panoramas", como se conocía a su lugar de trabajo en Montevideo.
